import s from "./Music.module.css";
const Music = () => {
    return <div className={s.music}>
        <h2>MUSIC</h2>
        <img src="https://lh3.googleusercontent.com/proxy/kxNJcGWB1rPSE4SV-k7CfarmsUN8gJvn-gUB6zQ9b-WGLITpqyCnQn9vUzevSfvG_gRRzt_X1NGvEmrS7UFyUolwVurALuofFP--vdbP1R0eJ0tkqijuDALd0uVu1VI3_fBeX4Q" alt=""/>
        <p>Lady gaga</p>
        <p>50 cent</p>
        <p>eminem</p>
        <p>Imagine Dragons</p>
    </div>
}

export default Music;
